import "./App.css";
import { Link as ScrollLink } from 'react-scroll';

const NavBar = () => {
    return(
    <div className="navBar">
        <ScrollLink to='Home' spy={true} smooth={true} offset={0} duration={600} className='navBarButton'>Home</ScrollLink>
        <ScrollLink to='News' spy={true} smooth={true} offset={-150} duration={600} className='navBarButton'>News</ScrollLink>
        <ScrollLink to='Events' spy={true} smooth={true} offset={-50} duration={600} className='navBarButton'>Events</ScrollLink>
        <a className="navBarButton" href="https://nphs.npenn.org/" target="_blank" rel="noreferrer">BLOG</a>
    </div>
    )
}

export default NavBar;
